pragma solidity ^0.6.0;

import "openzeppelin-solidity/contracts/token/ERC721/ERC721.sol";

contract NFT is ERC721 {
    constructor(string memory _name, string memory _symbol) ERC721(_name, _symbol) public {
    }

    function mintTo(address recipient) public returns (bool) {
       uint256 newTokenId = _getNextTokenId();
      _mint(recipient, newTokenId);
    }

    function _getNextTokenId() private view returns (uint256) {
      return totalSupply().add(1);
    }
}

contract ContractFactory {

    address[] public contracts;
    address public lastContractAddress;

    function getContractCount() public view returns(uint contractCount) {
      return contracts.length;
    }

    function deploy(string memory name, string memory symbol) public returns(address newContract){
      NFT c = new NFT(name, symbol);
      address cAddr = address(c);
      contracts.push(cAddr);
      lastContractAddress = cAddr;

      return cAddr;
    }
    function mint(NFT tokenAddress) public {
      tokenAddress.mintTo(msg.sender);
    }
}
